export const messages = {
    authentication : {
        SIGNUP_SUCCESS : '* The email is registered successfully. Please press the login Button to login',
        SIGNUP_FAILURE : '* The email is already registered. Please try with a different email',
        LOGIN_FAILURE : '* The email or password you have entered is wrong'
    }
}
